import React, {Component} from 'react';

class Home extends Component {
    render() {
        return (
            <div className="container h-100 row">
               <div className="col-sm-12 my-auto" id="buttonNav">
                   <button className="btn-primary ml-3">button 1</button>
                   <button className="btn-primary ml-5">button 1</button>
                   <button className="btn-primary ml-5">button 1</button>
                   <button className="btn-primary ml-5">button 1</button>
               </div>
            </div>
        );
    }
}

export default Home;
